def extendedEuclid(a, b):
	remainder = -1
	x1 = 1
	x2 = 0
	y1 = 0
	y2 = 1 
	if a > b:
		divisor = b 
	else:
		dividend = b
	divisor = a 
	while remainder != 0:
		gcd = remainder
		quotient = dividend // divisor 
		remainder = dividend % divisor 
		temp1 = x1 - x2 * quotient
		x1 = x2
		x2 = temp1
		temp2 = y1 - y2 * quotient
		y1 = y2
		y2 = temp2
		dividend = divisor
		divisor = remainder
	if a > b:
		return [x1,y1,gcd]
	else:
		return [y1,x1,gcd]

